// Navbar.js
import React from 'react';
import './Navbar.css';
import logo from './public/FileS-logos_white.png'; // Assuming the logo is named logo.png and is in the public folder

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="navbar-left">
                <img src={logo} alt="Logo" className="navbar-logo" />
            </div>
            <div className="navbar-right">
                <a href="#" className="navbar-item">Home</a>
                <a href="#" className="navbar-item">My Files</a>
                <a href="#" className="navbar-item">Shared with Me</a>
                <a href="#" className="navbar-item">Trash</a>
                <a href="#" className="navbar-item">Settings</a>
            </div>
        </div>
    );
}

export default Navbar;
